function App() {
  return (
    <div className="App">

    <NavBar/>
      <Switch>
        <Route exact path="/" component={Dashboard}/>
        <Route path="/post/:id" component={PostDetails}/>
        <Route path="/signin" component={SignIn} />
        <Route path="/register" component={Register} />
        <Route path="/uploadPost" component={UploadPost} />
      </Switch>
    </div>

  );
}

export default App;
